import React from "react";

const FreeIaModelsPage = () => {
  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center justify-center p-10">
      <h1 className="text-4xl font-bold text-gray-800 mb-6">Modèles IA Gratuits</h1>
      <p className="text-gray-600 text-lg max-w-3xl text-center">
        Téléchargez nos modèles d'Intelligence Artificielle prêts à l'emploi.
      </p>
    </div>
  );
};

export default FreeIaModelsPage;
